import React from "react";
import classes from "./Dialogs.module.css";

const Dialogs = (props) => {
  return (
    <div className = {classes.dialogs}>
      <div className= {classes.dialogs_item}>
        <div className={classes.dialog}>Sasha</div>
        <div className={classes.dialog}>Oleg</div>
        <div className={classes.dialog}>Dima</div>
        <div className={classes.dialog}>Ivan</div>
        <div className={classes.dialog}>viktor</div>
      </div>
      <div className={classes.messages}>
        <div className={classes.message}>Hi</div>
        <div className="messag">How is your progect</div>
        <div className="messag">Yoooo</div>
      </div>
    </div>
  );
};

export default Dialogs;
